import React from 'react';
import '../App.css';
import logo from '../logo.svg';

function Nav() {
  return (
    <div className="nav">
      <nav>

        <ul className="nav-links">
            <li>About</li>
            <li>Events</li>
        </ul>
      </nav>
    </div>
  );
}

export default Nav;
